import React from 'react';
import { Route, Switch } from 'react-router-dom';
import Home from "./Home";
import 'swiper/swiper.scss';


import './App.css';

const App = () => (
  <Switch>
    <Route exact={true} path="/" component={Home} />
  </Switch>
);
export default App;
